import React, { Component } from 'react'
import logo from '../../public/logo192.png'

import Carouselku from '../components/Carouselku'

class Home extends Component {
    render() {
        return (
            <div>
                <Carouselku/>
                <div>
                    {/* <h1 className="text-center">Home</h1> */}
                    <img src={logo} alt=""/>
                </div>
            </div>
        )
    }
}

export default Home
